import React from 'react';
import { ShoppingCart } from 'lucide-react';

const Orders = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Orders</h1>
        <p className="text-gray-500">View and manage orders with bundle products</p>
      </div>

      <div className="text-center py-12">
        <ShoppingCart className="w-16 h-16 text-gray-400 mx-auto mb-4" />
        <h3 className="text-lg font-medium text-gray-900 mb-2">Orders Management</h3>
        <p className="text-gray-500">Bundle order tracking and management coming soon!</p>
      </div>
    </div>
  );
};

export default Orders;
